import React from 'react';

function Food(props) {
  console.log(props);
  return <div className='App' />
}

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Food fav='kimchi' />
      <Food fav='ramen' />
      <Food fav='kimbap' />
    </div>
  )
}

export default App;
